import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'
import Form from './Form/Form';
import Spreadsheet from './Spreadsheet/Spreadsheet';
import Analytics from './Analytics/Analytics';
// import './landing.css'


class Landing extends Component {
    
    render() {

        return (
            <Router>
                <div className="landing">
                    <div className ="background">
                        <div className="container">
                            <div className="mainLinks">
                                <div id="form" className="button"><Link to="/form" className = "links">Form</Link></div>
                                <div className="button"><Link to="/spread" className="links">Spread</Link></div>
                                <div className="button"><Link to="/analytics" className="links">Analytics</Link></div>
                                
                                
                            </div>
                        </div>
                        <Route path="/form" exact render={() => <Form />} />
                        <Route path="/spread" exact render={() => <Spreadsheet />} />
                        <Route path="/analytics" exact render={() => < Analytics/>} />
                    </div>
                </div>
            </Router>
        )
    }
}





export default Landing;
